import "./Footer.css";
const Footer = () => {
    return (
       <footer id = "footer">

           <div className ="rightfooter">
               <h1>LvTs-Tracker</h1>
               <p>We manage your leaves </p>
           </div>

       </footer>
    );
}

export default Footer
